import { useState } from "react";
import api from "../api";

function Musicas() {
  const [listaMusicas, setListaMusicas] = useState([]);

  function teste() {
    api
      .get()
      .then((res) => {
        console.log(res);
        setListaMusicas(res.data)

      })
      .catch((erro) => {
        console.log(erro);
      });
  }

  return (
    <>
      <h1>Titulo</h1>

      <button onClick={teste}>Teste</button>
    </>
  );
}

export default Musicas;
